import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

  constructor(props) {
      super(props);
      this.state = {
        cow
      };
  }

  render() {

      return (
        <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Checkout Directory
          </p>
        </header>
      </div>
      );
  }
}

export default App;
